import logo from './logo.svg';
import React, {Suspense, useEffect} from 'react';
import{Helmet} from "react-helmet";

import './App.css';
import {OriginalUI} from './original_ui/OriginalUi.jsx';

//const OriginalUI = React.lazy( () => import('./original_ui/OriginalUi.jsx') )

function App() {

  useEffect(() => { 

    function setUpJFAPI(){

      //initialise the script
      function initScript(APIScript){
        APIScript.initialize( {apiKey: "f78958f78beefa5e3e88255e7559579b"} ); 
      }

      setTimeout( () => {
        try{
          initScript(window.JF); 
        }
        catch(err){
          console.log(`the err is ${err}`)
        }
      },5000);



      //  try{
      //  initScript();
      //  }
      //  catch{ 'the err is' }
    }
    setUpJFAPI();

  })

  return (
  <>
    <h1>Push Notification Control Panel</h1>
    <Helmet>    <script id="jotform-api-script" src="https://js.jotform.com/JotForm.js">{}</script> </Helmet>
    <Suspense>{window.JF && <OriginalUI/>}</Suspense>
    <OriginalUI/> 



  </>
  );
}

export default App;
